import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./Component/Home/Home.jsx";
import Cart from "./Component/Cart/Cart.jsx";
import Dashboard from "./Component/Sliding/Sliding.jsx";

function App() {
  return (
    <Router>
      <Routes>
        {/* Home Page - You can also include the Dashboard here */}
        <Route path="/home" element={<Home />} />

        {/* Cart Page */}
        <Route path="/cart" element={<Cart />} />

        {/* Dashboard - If you want it accessible from the root, or you can modify it based on routing */}
        <Route path="/" element={<Dashboard />} />
      </Routes>
    </Router>
  );
}

export default App;
